from newrelic.agent import NewRelicContextManager
from pydantic import BaseModel, ValidationError

# Database configuration
DB_CONFIG = {
    'host': 'localhost',
    'database': 'fabs_db',
    'user': 'admin',
    'password': 'securepassword'
}

class FABSSubmission(BaseModel):
    submission_id: str
    publication_status: str
    data: Dict
    flexfields: Optional[Dict] = None

class DFileGenerator:
    @staticmethod
    def generate_d_file(fabs_data: pd.DataFrame, fpds_data: pd.DataFrame) -> pd.DataFrame:
        """Generate D file from FABS and FPDS data."""
        merged_data = pd.merge(fabs_data, fpds_data, on='transaction_id', how='left')
        return merged_data

class FABSValidator:
    def __init__(self, schema_path: str):
        with open(schema_path) as f:
            self.schema = json.load(f)

    def validate(self, fabs_data: Dict) -> bool:
        """Validate FABS data against schema."""
        try:
            FABSSubmission(**fabs_data)
            return True
        except ValidationError:
            return False

class DataCleaner:
    @staticmethod
    def process_deletions(target_date: datetime.date) -> int:
        """Delete records older than target_date."""
        conn = psycopg2.connect(**DB_CONFIG)
        cursor = conn.cursor()
        query = "DELETE FROM submissions WHERE created_at < %s"
        cursor.execute(query, (target_date,))
        deleted_rows = cursor.rowcount
        conn.commit()
        conn.close()
        return deleted_rows

class PublicationManager:
    @staticmethod
    def update_publication_status(submission_id: str, status: str) -> bool:
        """Update publication status of a FABS submission."""
        conn = psycopg2.connect(**DB_CONFIG)
        cursor = conn.cursor()
        query = "UPDATE submissions SET publication_status = %s WHERE submission_id = %s"
        cursor.execute(query, (status, submission_id))
        conn.commit()
        updated = cursor.rowcount > 0
        conn.close()
        return updated

    @staticmethod
    def prevent_double_publishing(submission_id: str) -> bool:
        """Check if submission is already published."""
        conn = psycopg2.connect(**DB_CONFIG)
        cursor = conn.cursor()
        query = "SELECT publication_status FROM submissions WHERE submission_id = %s"
        cursor.execute(query, (submission_id,))
        result = cursor.fetchone()
        conn.close()
        return result[0] == 'published' if result else False

class CodeDeriver:
    @staticmethod
    def derive_funding_agency_code(data: Dict) -> str:
        """Derive funding agency code based on business rules."""
        # Simplified business logic example
        if data.get('federal_agency'):
            return data['federal_agency'][:4].upper()
        return 'UNKN'

    @staticmethod
    def derive_ppop_code(data: Dict) -> str:
        """Derive PPoP code based on business rules."""
        # Simplified business logic example
        program = data.get('program', '').replace(' ', '')[:3].upper()
        project = data.get('project', '000')[:3].zfill(3)
        return f"{program}-{project}"

class FlexFieldProcessor:
    @staticmethod
    def process_flexfields(submission_id: str, flexfields: Dict) -> bool:
        """Process flexfields for a submission."""
        conn = psycopg2.connect(**DB_CONFIG)
        cursor = conn.cursor()
        query = "UPDATE submissions SET flexfields = %s WHERE submission_id = %s"
        cursor.execute(query, (json.dumps(flexfields), submission_id))
        conn.commit()
        updated = cursor.rowcount > 0
        conn.close()
        return updated

class DatabaseManager:
    @staticmethod
    def update_validation_rules(new_rules: Dict) -> bool:
        """Update validation rules in the database."""
        conn = psycopg2.connect(**DB_CONFIG)
        cursor = conn.cursor()
        query = "UPDATE validation_rules SET rules = %s"
        cursor.execute(query, (json.dumps(new_rules),))
        conn.commit()
        updated = cursor.rowcount > 0
        conn.close()
        return updated

    @staticmethod
    def add_gtas_data(gtas_data: List[Dict]) -> bool:
        """Add GTAS window data to the database."""
        conn = psycopg2.connect(**DB_CONFIG)
        cursor = conn.cursor()
        query = """
        INSERT INTO gtas_data (window_id, fiscal_year, data) 
        VALUES (%s, %s, %s)
        """
        for record in gtas_data:
            cursor.execute(query, (record['window_id'], record['fiscal_year'], json.dumps(record['data'])))
        conn.commit()
        conn.close()
        return True

    @staticmethod
    def load_historical_fabs_data(fabs_data: List[Dict]) -> bool:
        """Load historical FABS data into the database."""
        conn = psycopg2.connect(**DB_CONFIG)
        cursor = conn.cursor()
        query = """
        INSERT INTO historical_fabs (submission_id, data, created_at) 
        VALUES (%s, %s, %s)
        """
        for record in fabs_data:
            cursor.execute(query, (record['submission_id'], json.dumps(record['data']), record['created_at']))
        conn.commit()
        conn.close()
        return True

